=head1 DESCRIPTION

Contains information about an unused access finding for an action. IAM
Access Analyzer charges for unused access analysis based on the number
of IAM roles and users analyzed per month. For more details on pricing,
see IAM Access Analyzer pricing
(https://aws.amazon.com/iam/access-analyzer/pricing).

